import React, { useState } from 'react';

function App() {

  const counter = useState(0)


  function incrementCounter(){
    counter++;
  }

  return (
    <>
      <h1>Contador: 0</h1>
      <button onClick={incrementCounter}>Incrementar</button>
    </>
  );
}

export default App;
